// src/pages/SavedFundsPage.js
export default function SavedFundsPage() {
  return (
    <div className="min-h-screen p-6 bg-gray-50">
      <h2 className="text-2xl font-semibold mb-4">Saved Mutual Funds</h2>
      <div className="space-y-4">
        {/* Example saved fund */}
        <div className="bg-white p-4 rounded shadow flex justify-between items-center">
          <div>
            <h3 className="font-bold">Axis Bluechip Fund</h3>
            <p className="text-sm text-gray-500">Equity · Direct · Growth</p>
          </div>
          <button className="text-red-500 hover:underline">Remove</button>
        </div>
      </div>
    </div>
  );
}
